import React from 'react';
import { Link } from 'react-router-dom';
import './SideNavbar.css';

export default function SideNavbar() {
  const sideNav = [
    {
      name: 'Dashboard',
      to: '/',
    },
    {
      name: 'Students',
      to: '/students',
    },
    {
      name: 'Course',
      to: '/Course',
