      to: '/',
    },
    {
      name: 'Dashboard',
      to: '/',
    },
    {
      name: 'Dashboard',
      to: '/',
    },

  ];

  return (
    <div class='col-2'>
      <ul className='list-unstyled'>
        <li>
          {sideNav.map((el, i) => 
            (<Link to={el.to.toLowerCase()} className='text-decoration-none'>
            {el.name}
          </Link>)
          )}
        </li>
      </ul>
    </div>
  );
}
